import React from "react";
import "./NavTop2.css";
import mountain from "../../../Image/mountain.jpeg";

const NavTop2 = () => {
  return (
    <div className="row in-chatt">
      <div className="col ">
          <div className="wrapp-desc">
            <img src={mountain} alt="" className="float-left" width="80"/>
          <h5>Abdillah</h5>
          <p>Online</p>
          </div>
        </div>
      </div>
  );
};

export default NavTop2;
